import React from 'react'
import stayTuned from './stayTuned.svg'
import './Ongoin'

function Ongoingcourses() {
  return (
      <div className='ongoingCourses'>
          <img src={stayTuned} />
          <h1>Stay Tuned</h1>
    </div>
  )
}

export default Ongoingcourses
